body{
    font-family: fantasy;
    background-image: url("../images/background-light.png");
    /* background-repeat: y; */
    background-size: cover; 
    width: 100vw;
    height: 100vh;
    padding: 0;
    margin: 0;
    box-sizing: border-box;
    overflow-x: hidden;
}
.body-theme {
    color: white
}

/* @COMMON Component START */
.compo-title {
    font-size: 2rem;
    border-bottom: 0.2rem solid navy;
    margin-bottom: 1rem;
}

/* @COMMON Component END */

/*@Header START */
header{
    position: fixed;
    top: 0;
    display: flex;
    align-items: center;
    justify-content: flex-end;
    height: 80px;
    width: 100%;
    margin-bottom: 2rem;
    box-sizing: border-box;
    z-index: 1;

}
img{
    position: absolute;
    left: 0;
    width: 70px;
}

nav{
    display: flex;
    align-items: center;
    justify-content: flex-end;
}
.nav-menu{
    font-family: initial;
    font-weight: bold;
    padding: 0.5rem 1rem;
    box-sizing: border-box;
    border: solid gray;
    background: rgba(255,255,255,0.7);
    transition: .5s;
}
.nav-menu:hover {
    border: solid rgb(48, 48, 48);
    color: gray;

}
.nav-menu:last-child{
    margin-right: 1rem;
    box-sizing: border-box;
}
/*@Theme START */
.theme-group{
    margin-right: 1rem;
    display: flex;
    align-items: center;
}
.theme-title {
    margin-right: 1rem;    
}
.theme{
    display: flex;
    align-items: center;
    border: solid black;
    border-radius: 50vh;
    height: 2rem;
    width: 3.5rem;
    background: rgba(255,255,255,0.7);
    transition: .3s;

}
.theme-theme {
    background: rgba(0,0,0,0.7);
    border: solid white;
}
.clicked-circle{
    animation: right .3s forwards;
}
.circle {
    border: solid gray;
    border-radius: 50vh;
    height: 1.5rem;
    width: 1.5rem;
    display: flex;
    align-items: center;
    justify-content: center;
    padding: 0;
}
.circle-in-circle{
    border: solid gray;
    border-radius: 50vh;
    height: 1.1rem;
    width: 1.4rem;
    background: black;
}
.circle-theme{
    background: white;
}

/* @Header and Theme END */

/* #App start */
#app{
    padding: 0;
    width: 100%;
    top: 120px;
    box-sizing: border-box;
    position: relative;
    flex-direction: column;
    align-items: center;
    justify-content: center;
}
/* @ Login START */
/* login style is mainly shared with signup style.  */
.user-notification{
    display: flex;
    width: 50%;
    border: solid black;
    border-radius: 0.5rem;
    padding: 1rem;
    background: rgba(255, 209, 209, 0.9);
    margin-bottom: 2rem;
}
.login-notify-container {

}
.login-notify-text{
    margin-bottom: 1.5rem;
}

/* @ Login END */
/* @ HOME START */
#main{
    display: flex;
    flex-direction: column;
    align-items: center;
    width: 100%;
    min-height: 100%;
}
.main-container{
    text-align: center;
    border: 0.4rem solid rgb(16, 16, 78);
    background: rgba(255,255,255,0.7);
    width: 100%;
    padding: 1rem;
    display: flex;
    align-items: center;
    box-sizing: border-box;

}
.home-each-section {
    flex-basis: 70%;
    font-size: 2rem;

}
.home-each-section-fa-cog{
    position: relative;
    flex-basis: 30%;
    display: flex;
    align-items: center;
}
.fa-cog{
    color: #ccc;
