                -2px  2px 10px #777 ,
                 2px -2px 10px #777 ,
                -2px -2px 10px #777;
}
.big-cog{
    font-size: 15rem;
    animation: cogs 20s linear infinite;
}
.small-cog{
    font-size: 10rem;
    animation: cogs 20s linear reverse infinite;

}
.home-title{
    font-family: cursive;
}
.quiz-type{
}
.start-button{
